// Imports
import React, { Component } from 'react';
import './textfield.css';

class Textfield extends Component {
  render() {
    return (
      <div style="border: 1px solid #DDD;">
        <img src="icon.png"/>
        <input style="border: none;"/>
      </div>
    );
  }
}

export default Textfield;
